import React, { useRef, useState } from "react";
import jsPDF from "jspdf";
import "../contact/contact.css";
import Phone from "../../img/phone.png";
import Email from "../../img/email.png";
import Address from "../../img/address.png";
import emailjs from "@emailjs/browser";

export const Contact = () => {
  const formRef = useRef();
  const [done, setDone] = useState(false);

  const sendEmail = (e) => {
    e.preventDefault();
    const downloadCV = () => {
      const doc = new jsPDF();
  
      // Add content to the PDF
      doc.text("Your CV content goes here", 10, 10);
  
      // Save the PDF as a blob
      const pdfBlob = doc.output("blob");
  
      // Create a download link
      const downloadLink = document.createElement("a");
      downloadLink.href = URL.createObjectURL(pdfBlob);
      downloadLink.download = "CV.pdf";
  
      // Append the download link to the body and trigger the download
      document.body.appendChild(downloadLink);
      downloadLink.click();
  
      // Clean up: remove the download link from the body
      document.body.removeChild(downloadLink);
    };

    emailjs
      .sendForm(
        "service_jxzx4gs",
        "template_y631q63",
        formRef.current,
        "RC3-2PV51Y0dyqagL"
      )
      .then(
        (result) => {
          console.log(result.text);

          setDone(true);
          formRef.current.reset();
        },
        (error) => {
          console.log(error.text);
        }
      );
  };

  return (
    <div className="c">
      <div className="c-bg"> </div>
      <div className="c-wrapper">
        <div className="c-left">
          <h1 className="c-title">Let's discuss your project </h1>
          <div className="c-info">
            <div className="c-info-item">
              <img src={Phone} alt="" className="c-icon" />
              +977-9863-913-049
            </div>
            <div className="c-info-item">
              <img className="c-icon" src={Email} alt="" />
              dineshlohani333@gmail.com
            </div>
            <div className="c-info-item">
              <img className="c-icon" src={Address} alt="" />
              Kanti Path, Kathmandu 44600, Nepal
            </div>
          </div>
          <div class="main-font">
            <button id="btn" onClick={downloadCV}>
              <spam id="symbol">
                <spam>â¬‡</spam>
              </spam>
              <spam id="text"> Download CV</spam>
              <div id="progress"></div>
            </button>
          </div>
        </div>

        <div className="c-right">
          <p className="c-desc">
            <b>What's your story?</b> Get in touch.Always available for
            freelancing if the right project comes along me.
          </p>
          <form ref={formRef} onSubmit={sendEmail}>
            <div className="input-group">
              <div>
                <input type="text" id="name" className="..." required />
                <label htmlFor="name" class="input-group label">
                  Full Name
                </label>
                <br />
              </div>
              </div>
              <div className="input-group">
              <div>
                <input type="email" id="email" className="..." required />
                <label htmlFor="email" class="input-group label">
                  Email
                </label>
                <br />
              </div>
              </div>
              <div className="input-group">
              <div>
                <input type="textarea" id="Subject" className="..." required />
                <label htmlFor="Subject" class="input-group label">
                  Subject
                </label>
                <br />
              </div>
              </div>
              < div className="input-group">
              <div>
                <input type="textarea" id="message" className="..." required />
                <label htmlFor="message" class="input-group label">
                  Message
                </label>
                <br />
              </div>
              
            </div>
            <input type="submit" value="Submit" className="submit" />
            {done && "   ...thank you..."}
          </form>
        </div>
      </div>
    </div>
  );
};
export default Contact;
